import React from 'react';
import './App.css';
import "./navBar";


function App() {
    return (
        <div className="App">
            <title>Learning Square</title>
            <NavBar/>
            <div className="App-header">
            <p>This is a learning page</p>
            <a
                className="App-link"
                href="https://reactjs.org"
                target="_blank"
                rel="noopener noreferrer"
            >
                Learn React
            </a>
            </div>
        </div>
    );
}

export default App;
